                    "lore": {
                        "story": "    The ancient infamous river of hell, Styx, lies at the cusp of the mortal world and hell. Upon this dreaded river of oaths lies a spire, dark castle partially obscured by gray, depressing clouds. The landscape around the structure is entirely desolate. This is where I reside. I am the Goddess Styx of the Greek Pantheon.\n    Per my routine, I drag my feet into the hall lit by fiery red hellfire pits. I take a seat on my throne of bones raised on a platform. The infinite hall is adorned with the skulls of every creature that has walked the world of the living. Large red pillars support the high arched ceiling covered with elaborate motifs of the devil himself. Every structural detail is a shade of blood red to honor the aesthetics of hell. The grand hall is gated by large, magnificent wooden doors to control the hoards of souls and avoid overcrowding.\n    Pale, translucent, tormented ghosts of people who refuse to pass on from the material world roam freely in this in-between realm. They haunt the halls with burning envy. The souls who just entered hell are queued up in thousands inside the hall and outside the gates. They cry in agony as they wait for their turn. The weight of their misfortune sags heavily on my shoulders. The destination of the souls everlasting torment is decided upon in this room, and I am its sole judge.\n    For centuries, I have been burdened with the responsibility of deciding the fate of which tier of hell each soul belongs to. The task is essential yet tedious. My ghouls and some minor demons assist me. The demons guard the room while the ghouls serve by following my beck and call.\n    A ghoul drags the first soul before me: a young woman guilty of stealing. Although a petty crime, it is still considered a deadly sin in the underworld. I am surprised to notice that, unlike the other unfortunate souls in the room, this woman seems unfazed by her fate. She stands proudly before me with her scrawny little shoulders squared up. Arrogant, I think to myself.\n    The ghoul urges the woman to state her case, which is usually my cue to drum my fingers on the arm of my throne and disassociate. I have heard these stories a million times, and nothing intrigues me anymore. A soul can commit only so many sins.\n    I notice the glimmer of resolution in the womans eyes as she refuses to beg for mercy. Instead, she proudly claims to have done it for her family's survival. Furthermore, she declares to have made peace with her eternal punishment.\n    I burst into laughter at her naivety. Groveling at my feet is her only chance of mercy. I rarely encounter souls like her who refuse to bend the knee. I admire their resolution, but eternal punishment in hell can break the bravest of souls. I smile as I pass my judgment with some hesitation. I send her to the seventh circle of hell, where she will spend the rest of eternity being trapped in a repeated cycle of torment for a sin she was forced to commit.\n    At moments like these, I realize how little power I wield. I do not think this woman deserves to be here, nor do I believe that my judgment of her crime is justified, but alas, I am a God, and yet I am a servant of hell.\n    My authority is limited. My job is not to decide if a soul deserves to be in hell, but it is to determine the place and the tools of the soul's damnation. Hell is a bureaucratic place, no different from the mortal world, and I am just a cog in its machine.\n    I watch as the demons guide the woman out of the hall and wonder if I could be as graceful as her if I were in her shoes. I hope she does not regret her impertinence, even though I am almost confident she will. The thought lingers in my mind for a fleeting moment before the next unfortunate soul is dragged in front of my eyesight as the vicious cycle of hell continues for another eternity.",
