                    "lore": {
                        "story": "The sun has set, and chaos has dug its claws into the castle grounds. A large crowd of protestors is gathered at the gates, holding torches and chanting, Free Officer Silas Blackwater! at the top of their lungs. Tensions start rising as the crowd bursts through the gates, and the guards struggle to keep them at bay.\n    Zephyr passes by the mayhem of the guards dragging Officer Blackwater. He makes a beeline to the throne room, down a long hallway flanked by shiny marble pillars on both sides. He notices two figures sneaking around; he instantly recognizes them as high-ranking guild members as he sneaks around the pillars, searching for the right moment to strike.\n    Monk and Death Adder seem to be arguing, distracted enough that they dont detect Zephyrs presence. The argument turns sour as Monk faces away from Adder and starts kicking the sizeable solid wood double doors in an attempt to break them open.\n    Adder, annoyed and facing the door, commands Monk, Stop! That will not work; it is some sort of magic!\n    Adder walks towards Monk and shoves him to the side as she inspects the intricate locking system. Purple magical plasma starts floating around Adders hand. Zephyr takes this opportunity to surprise Monk by punching him across his face.\n    Unconscious, Monks body slams onto the marble floor with a thunk, causing Adders concentration to break and look toward the source of the sound.\n    Caught in action, Zephyr lunges towards Adder to rush her. Adder is quick to use her magic and knock Zephyr back. Tsk, tsk, tsk. Look whos here to save the day, remarks Adder as she circles a winded Zephyr on the floor.\n    How did you get in? questions Zephyr as he gets off the floor. Adder laughs as she tries to strike Zephyr again but misses.\n    Zephyr, impatient, speaks up again, What do you want, Adder? I am in the middle of something.\n    You know what I want. I want this kingdom to be free of its tyrannical ruler, states Adder.\n    Right, and you want this for the kingdom and not just for your gain? questions Zephyr as he chuckles.\n    The moment is interrupted by a loud, gut-wrenching scream from inside the throne room. The pair look at each other in confusion. Zephyr rushes to the door and yanks the crystal tied around his neck. He uses it to unlock the door.\n    Ah, should have thought about that, remarks Adder as she gestures with her arms for Zephyr to proceed. Surprised by the lack of protest from Adder, Zephyr slams the door open.\n    The room is full of green smoke. The smoke slowly dissipates but still coats a thin layer inside the pairs throats. Adder starts to cough aggressively, and Zephyr stifles a fit while covering his mouth. They carefully walk further into the room toward the throne.\n    Father? Zephyr calls out. No response.\n    Panicked, FATHER?\n    Caw, is all he hears in response.\n    Zephyr walks closer to the source of the sound and notices a raven perched on a pile of clothes between the crown's rims on the throne. It turns to look at Zephyr with wide eyes, Caw, Caw!\n    Zephyr is stunned, his mind reeling. He staggers backward and falls, unable to form a coherent thought. He stares at the raven, his next move uncertain.\n    Adder stifles her cough long enough to help Zephyr to his feet. She smirks at the scene before them and asks, I wonder who could have done this?\n    Is that? Zephyr's voice trails off, his eyes fixed on the raven.\n    \"Indeed, I guess there is a job vacancy,\" Adder states, her words hanging in the air, thick with anticipation.",
