                    "description": "Throw cluster bombs at your enemies and watch them go flying! Blast off with your Rocket Boost ability.",
                    "lore": {
                        "story": "    The moonless night is devoid of stars. The air is bone-chillingly cold. The wind is howling as the intense snowstorm continues. Everything you can lay your eyes on is covered with a thick layer of white snow. Our little camp lies next to the tree line of the forest grounds, tucked under the covers of tall bushes.\n    The chief, a wise, graying old woman of our tribe, has called an emergency meeting to discuss the next course of action. As I stand there shivering, surrounded by my family and friends, I observe our dwindling numbers. I realize how many lives we have lost to the great winter and how many families have been torn apart by nature's cruelty. I, too, have lost my younger sister and my father. A loss that seems to have broken my mothers will.\n    The Chief proposes a contentious plan to abandon our current location in search of a warmer one, even though it is unlikely that we will find such a place. The members debate whether this desperate plan is even worth considering. The stakes are high either way, but this proposal has created a rift.\n    Desperate, a section of our tribe decides to part ways in hopes of finding a better future. With the few resources we have left, they start preparing for their deadly journey. I close my eyes and take a deep breath. I pray to some higher power to guide us in these harsh times.\n    As I slowly open my eyes and exhale, I notice that everyone at camp seems to be staring off in the distance. I turn my head to look at the spot and see a bright yellowish-orange silhouette of a figure emitting immense light and heat.\n    As the godly figure approaches the group, we are all engulfed in a warm hug. The heat pulsing off the figure is welcoming after the deadly cold weve endured for over a year. I look closer at the figure and notice that it has human-like features, yet there is nothing human about it.\n    Members of the tribe start backing away in fear. The chief takes this as her cue to confront the entity. What who are you? she questions. The figure cocks their head to the side as if theyre amused. I am Agni, the God of fire, the entity responds.\n    Fire? the Chief asks again in confusion. The figure extends their palm out, and an orb of pulsing heat, like the sun, starts floating in it. The chief is startled but leans in to inspect the bright orb of light. She then reaches out her index finger to touch it, but Agni pulls their palm away.\n    Careful, the fire will burn you. Let me demonstrate, says Agni as they fling the ball toward the dead tree in the forest. The ball fizzles as it hits the dry trunk of a tree and sets it on fire. Soon enough, the whole forest is engulfed in red. The heat from the fire starts melting the snow around the area.\n    I have never seen such a magnificent view in my life, and judging by the expressions on the faces of my tribe members, neither have they. The crowd cheers as they bow to Agni. Remember, fire is not only the bringer of life but also its destroyer, Agni states before vanishing into the thin, smoky air, never to be reencountered.\n    Decades after this incident, the gift of fire kept evolving. It not only saved our tribe from extinction but also aided in our rapid growth and advancement. We went from being savage hunters and gatherers to building modern farming societies. However, through time, Agni and his contribution have been forgotten. They have been written off as myths. I am the last witness of that heavenly day, and I am to become the next chief of our tribe. I pledge to keep the tale alive and keep the flames of Agni burning to the end of times.",
