                "Name": "SpiritAssassinController",
                "kitMeta": {
                    "description": "Damage enemies to attract nearby spirits. Consume spirits to instantly teleport and gain an attack buff for a short duration.",
                    "bedCoinProduct": {
                        "bedCoinProductId": 22
                    },
                    "difficulty": 3,
                    "priceRobux": 399,
                    "name": "Evelynn",
                    "lore": {
                        "story": "    Evelynn passes through the iridescent veil as wispy spirits dance around her. She enters the familiar magical world and lets out a sigh of frustration. The Spirit Owl perched on Evelynns shoulder disappears, hinting to her that Whisper has left his meditative state and is probably stomping on his way to confront her.\n    Evelynn sits under an enormous glowing tree to enjoy the calm before the storm. She observes the realm while she waits. She can hear a peaceful hum ringing while it encompasses her soul with peace.\n    The peace turns to irritation as Evelynn spots Whisper in the distance. She knows an argument is coming her way, as it always is with Whisper. She isnt particularly in the mood for a squabble.\n    You did not follow our plan, states Whisper as he walks towards her.\n    Lets not have this argument again. I did what I saw fit in the situation, Evelynn counters back.\n    Whisper sighs in disappointment as he continues, You always use that excuse. You could have been injured; we were outnumbered.\n    Evelynn rolls her eyes, We? You dont know what its like to be in combat!\n    Whispers eyes flash with pain. Evelynns guts twist in guilt as she speaks again, Look, Im sorry, I didnt mean it to come out the way\n    Before Evelynn could finish her sentence, Whisper speaks, I may not be there physically, but I am always looking out for you.\n    Suddenly, the world is engulfed in brightness as an ominous streak of light spontaneously appears, tearing through the fabric of the realm. Giant hideous creatures enter and start ravaging the serene landscape. Loud screeches from the spirits start echoing.\n    Evelynn and Whisper are stunned as hoards of spirits run toward the portal. Within the chaos, the pair spot Catherine running towards them.\n    Theyre trying to capture the spirits. We need to evacuate now! Catherine rambles as she pants heavily.\n    Where are the others? questions Evelynn.\n    Containing the invasion, Catherine responds.\n    Evelynn nods and teleports next to the portal as she tries to open it. Its stuck! she yells.\n    I think I have an idea, Whisper says as he assumes his meditative state.\n    The portal starts slowly opening, and the spirits rush out of it. I wont be able to hold it for long, Whisper mumbles through gritted teeth.\n    Catherine and Evelynn start guiding the spirits out. In the distance, the combat gets louder. Evelynn observes that Ignis and Aery are struggling to keep the creatures at bay.\n    Can you take care of this? I am going to help the others, commands Evelynn as Catherine nods in response.\n    Evelynn quickly teleports to join the front line and realizes how outnumbered they are. We should fall back and make our way to the portal! she exclaims.\n    The group carefully starts falling back. Evelynn turns around and notices that the spirits are evacuated as the three guardians halt, surrounding Whisper in a protective stance.\n    Whisper states, You guys should make a run for the portal. I cant hold it open any longer.\n    Evelynn urges, Go, go. I wont leave without Whisper.\n    Ignis and Aery start running. Whisper scrunches his eyes as he speaks again, You need to leave!\n    Didnt you hear me? I am not leaving without you. We are partners, Evelynn states as she uses her daggers to protect Whisper from the creatures.\n    Whisper lets out a painful sigh, Evelynn, please. You have to trust me. They need you now more than ever.\n    Desperate, Evelynn speaks, Promise me that youll be okay.\n    I promise, he responds with a forced smile.\n    Evelynn nods at Whisper and runs through the shimmering veil as it slowly starts closing. Once on the other side, she looks back at Whisper, who is trying to escape the creatures.\n    A teardrop falls from Evelynns eye as the portal swirls shut.",
