                "kitMeta": {
                    "description": "Build rage by damaging enemies. Instead of buying swords, your sword is upgraded upon reaching max rage. You lose half your rage upon death. Emerald Sword is replaced by the Rageblade.",
                    "bedCoinProduct": {
                        "bedCoinProductId": 3
