                    "difficulty": 1,
                    "priceRobux": 399,
                    "gamepassId": 19551065,
                    "lore": {
                        "story": "<b>Chapter I:</b>\n    Barbarian screams and thrashes as he is shoved inside a grimy, dark cell by two enormous guards under the fighting arena. He groans as he can feel his head throb painfully. The constant cheering of the crowd from above doesn't seem to help either. Barbarian waits for the guards to be gone, and then, slowly but agonizingly, he stands up and walks towards his cell door.\n    He observes the other unfortunate souls trapped inside the vast dungeon. He can barely tell the details of their faces as there is no natural light, just a couple of lamps in the corridor between the cages. Barbarian can only see the glimmer in the eyes of the prisoners; some shine with fear, while others seem to carry a fiery rage.\n    A sweet, high-pitched voice speaks up, and Barbarian can tell its coming from the cell next to his. You seem new! the voice exclaims.\n    Through the iron bars that separate their cells, he tries to make out the details of the persons appearance. He can only notice luminescent eyes and a tuft of white hair in the dark.\n    Barbarian only grunts in response as he is clearly not in the mood for a conversation. He lays down on the little cot in the corner of his cell. The room is mostly empty, apart from the cot, a toilet, and a small sink with an even smaller broken mirror.\n    With his head still spinning and eyes getting heavier, Barbarian drifts into a hazy, dark sleep.\n    He jolts awake as he hears the young woman causing a commotion. He can hear the loud cling of her handcuff as the guards unbind her and shove her onto the ground inside her cell. They slam the iron gate shut.\n    Barbarian, annoyed, closes his eyes again, and just as he is about to doze off, he hears the young woman whimper. He grunts and turns to his side, hoping to block out the sound.\n    The whimpering continues to get louder. Barbarian sighs and sits up. Without looking at the woman, he asks, Are you okay?\n    Her whimpering quiets down, and a heavy silence hangs between them, almost for a little too long. Barbarian debates whether to go back to sleep but hears her hoarsely say, No, but I will be.\n    Barbarian nods knowingly and turns to face her, asking, What happened?\"\n    I lost, she says.\n    First time? Amused, Barbarian questions.\n    No! she sighs before continuing, It was supposed to be my last fight before I am free from this place, she counters with irritation.\n    Barbarian still cant make out the details of her face but can see some green rocks embedded in what he assumes is her armor. Barbarian thinks to himself, Are those emeralds?\n    He snaps himself back into reality, saying, Right.\n    Barbarian feels a wave of dizziness come over him. He lies back down, staring blankly at the ceiling as the woman continues to talk.\n    I just freaked out. I dont know why, but I almost had it, but then suddenly I felt this dread consume me. I have never felt anything like that, and I just froze. Like a block of ice. It was enough time for him to knock me out.\n    Barbarian is still trying to brush off the dizziness and is caught off-guard by the confession.\n    The young woman picks up on his hesitation and continues, Im sorry for unloading. Its just hard being trapped here\n    Its okay, I understand. Its not exactly my first time being trapped like this either. Barbarian manages to mumble a response.\n    She continues, Well, how bad can another night in this cold dungeon be?\"\n    Barbarian doesnt respond. He can sense her waiting for him to elaborate, but as the silence continues, he hopes she gets the hint and does not push for more.\n    In the quiet, Barbarian lets out a deep breath he wasnt aware he was holding as he closes his eyes.\n    \n    \n<b>Chapter II:</b>\n    The heat is scorching high, burning Barbarians skin as the crowd cheers loudly. His opponent enters the arena. He is surprised to see a young woman with familiar bright white hair. He can now tell that the rocks he thought were emeralds embedded in her white armor are jade stones. Barbarian realizes he never learned her name, but his curiosity is quickly met as the arena master announces their names to the people.\n    As she starts stretching, Barbarian asks, Jade?\n    She chuckles and poses, In the flesh!\n    Barbarian is unsure what to expect from Jade as an opponent. He can see she is carrying a giant hammer adorned with her precious jade stones. He couldnt tell much about her skills as a warrior from their conversations the night before, but looking at her, he could assume that Jade was a seasoned warrior.\n    The crowd is roaring. Barbarian takes a few long breaths and wipes the beads of sweat trickling down his forehead as he positions himself. He makes eye contact with Jade, who nods at him in acknowledgment as the fight starts.\n    The two stand, awaiting the other's opening move. Neither fighter is eager to make the first attack or the first mistake. Tired of the standoff, Barbarian makes the first move by swinging his sword. Jade dodges, but the weight of her great hammer comes at a cost to her speed.\n    She takes a massive leap with her hammer, aiming for his head; Barbarian manages to dodge the attack. Jade leaves him no time to recover as she attacks again. Anticipating the ferocious blow, Barbarian quickly dodges and swings his sword, grazing at Jades stomach.\n    Jade winces in pain as she takes several steps back to recover. Barbarian sees the opening and rushes to exploit his opponent's weakness but hesitates. He tries to tell himself that he barely knows her and that one cordial conversation doesnt mean anything.\n    While Barbarian is busy contemplating, Jade seems to have recovered. She lets out a loud growl and starts to attack Barbarian repeatedly. Each time she slams her hammer down, she leaps closer and closer to him.\n    Barbarian is able to dodge the first couple of attacks, but eventually, he starts feeling the exhaustion of his movements. His actions become sloppier. He can see her open wound, but it doesnt seem to slow her down.\n    Barbarian braces himself for another furious impact. Drained, he misses the dodge, and the hammer smashes onto his ankle. He winces in pain. Jade lets out a little giggle. Barbarian realizes he might lose the fight if he doesnt match her energy.\n    He takes a deep breath and centers himself as he begins a new approach. Barbarian counters back every attack that Jade throws at him with ease. He feels confident again, the fire of battle burning in his chest.\n    However, the upper hand is short-lived as Jade swings her hammer sideways, a move she hasnt used yet, and Barbarian is struck by the sweeping blow. He stumbles and fails to brace his fall.\n    Before he can collect himself, she swings her hammer down upon his head. Blood starts dripping down his face, and his vision blurs as he looks up at Jade, who is heaving.\n    The arena master calls the end of the match, declaring Jade the victor. She raises her hammer as the crowd chants her name. The last thing that Barbarian notices is the relief wash over Jades face as his eyes get heavier and he loses consciousness.\n    \n\n<b>Chapter III:</b>\n    The guards slam Barbarians body against his cell's cold, hard floor. The impact wakes him, but he decides to lay there until he hears the sound of the guard's boots fade away in the distance. Barbarian could tell that he was very disoriented as his vision blurred in and out. He touches his face and feels the dried blood that has caked everywhere.\n    He sits up, trying to piece together the events of the past couple of hours with some difficulty. Although he has lost many fights, he didn't consider the possibility of losing to Jade. He admits to himself that his ego is slightly bruised.  He wonders if the outcome would have been any different if he had not hesitated to exploit her weakness during the fight.\n    He looks at the empty cell beside his own and realizes he is alone. The other prisoners in the dungeon dont seem friendly or interested in having a conversation. Even though he prefers solitude, he feels skeptical about surviving for too long without cordial human connection.\n    Barbarian gets up with some difficulty and walks towards the small, mucky sink in the corner of his cell. He splashes water on his face and stares at the bloody, red water swirling down the drain. He looks into the mirror and notices the swelling slowly creeping onto his face.\n    I can do this, he whispers to himself.",
