                    "difficulty": 3,
                    "priceRobux": 399,
                    "name": "Trixie",
                    "lore": {
                        "story": "    The clouds swirl as a storm continues to brew. Trixie and Evelynn huff and puff as they trek through the hills in high winds and relentless raindrops. More iridescent portals appear in the sky as hordes of void creatures spill through them. Evelynn and Trixie hide under the vegetation, stealthily making their way.\n\tPeculiar plants adorn the landscape, beautiful yet otherworldly. Almost all the fauna are bioluminescent, dimly lighting the environment. Although the sky is pitch black, ripples of purple light emit through the dark storm clouds.\n\tIn the distance, Trixie notices a blazing glow. She points it out to Evelynn and whispers, Look, there! Is that it?\n    Evelynn whispers, Yes, Ive always wondered what the source would be like. She looks at Trixie, notices her pale face, and asks, Are you okay?\n\tTrixie nods, questioning, Uh-huh, why wouldnt I be?\n    Evelynn responds, You look nervous. Are you sure youre up for this?\n    Evelynn notices Trixie visibly gulps as she waves her shaky hand. Yeah, I got it. I can do this! Trixie counters back, almost trying to convince herself.\n\tSuddenly, Evelynn stops in her tracks, and Trixie, still engrossed in her thoughts, bumps into Evelynns back.\n    We are here, Evelynn announces.\n    Trixie peaks from behind, as the warmth of the flower gently kisses her skin. Perched on top of a rock, the flower is surrounded by strange, enormous statues.\n    Mesmerised by its beauty, Trixie doesnt notice when Evelynn scans their surroundings for any threat before quickly climbing the rock on which the flower is perched.\n    Are you coming? Evelynn waves at Trixie.\n    Trixie follows timidly and comes face to face with the flower. Its beautiful! She exclaims breathlessly as her eyes sparkle in the radiant bloom. The warmth of the flower spreads with a tingling sensation through her body.\n    You ready? Evelynn questions.\n    Trixie nods. She reaches out to touch the flower. Instantly, an ethereal energy flows through her as her feet lift off the ground.\n\tI think its working, Trixie excitedly observes. The wind surrounding her intensifies, circling her as she floats even higher.\n\tA loud rustling sound is heard. Something is here, warns Evelynn as she quickly gets down from the rock. Void Knight jumps out of the bushes, catching her off guard. Evelynn manages to block his attack at the last moment.\n\tVoid Knight lets out a loud groan of frustration as he increases the intensity of his attacks. Evelynn starts to struggle; all she can do is defend herself. Desperation leaks out of her voice as she screams at Trixie, Hurry up!\n\tEntranced, Trixie doesnt respond, but Evelynn notices fewer portals in the sky. A sense of relief washes through Evelynns face, but the moment is short-lived. Two void creatures emerge from the bush cover, running towards Trixie.\n    Overwhelmed, Evelynn quickly throws her daggers, hitting one of the creatures right between its eyes, while the other is sliced at the ankle. Both the creatures slump to the ground, with one still slowly crawling toward Trixie.\n    As Evelynn is distracted, Void Knight takes a swing, and his sword slashes through Evelynns abdomen. She stumbles back, wincing in pain as she grasps onto the wound.\n    The last of the portals disappears. Trixie slowly opens her eyes, which glow with an otherworldly spark. She is still floating and emitting a flaming light like a star.\n    Void Knight screams in rage as more of the void creatures approach the girls. Trixie raises her hand, and a portal appears below the crawling creature in front of her, swallowing it. She turns to look at the horde running towards Evelynn, and this time, without even needing to raise a finger, Trixie conjures a portal right below the creatures as they fall through it and disappear.\n    Void Knight watches the scene in front of him in horror. As a last hurrah, he rushes towards Trixie, hoping to catch her off guard. Trixie smirks and says, Try me.\n    She stands still as Void Knights sword is about to make contact with her, but at the very last moment, she disappears and reappears behind him. Stunted, Void Knight turns around to swing his sword again as a portal opens below his feet. He screams in anguish as he falls into it.\n    Trixies eyes finally stop glowing as her feet touch the ground again. She rushes in to help Evelynn.\n    You did it, kid, Evelynn says, and she pats Trixies shoulder. Trixie gives her a toothy smile and responds, Lets get you home to Whisper, eh?",
